const ProductDetail = (props) => {
    const keys = [];
    for (const key in props.product[0]) {
        keys.push(key)
    }
    return <div>
        {keys.map((item, i) => <li key={props.product[0].id}>{[item]}: {props.product[0][item]}</li>)}
    </div>
}

export default ProductDetail
